import{_ as t,c as o,o as n,a5 as a}from"./chunks/framework.CqnjdYks.js";const r="data:image/png;base64,",A="/docs/cocos/assets/as-setting.DshgO8VY.png",e="/docs/cocos/assets/download-sdk.XxrVkZ8r.png",d="/docs/cocos/assets/confirm-change.z5Cj4jrM.png",s="/docs/cocos/assets/component-installer.CpYCBp6D.png",i="/docs/cocos/assets/sdk-location.EZ2G9ywR.png",p="/docs/cocos/assets/http-proxy.BA5gtFRc.png",l="data:image/png;base64,",c="/docs/cocos/assets/download-ndk-by-as.Cdtdd_FB.png",g="/docs/cocos/assets/download-ndk.DLukg4h8.png",h="/docs/cocos/assets/program.BWZSID8v.png",u="/docs/cocos/assets/ndk-dir.BWWlIvAR.png",m="/docs/cocos/assets/sdk-dir.D45UGZ5G.png",E=JSON.parse('{"title":"Android 原生开发环境配置","description":"","frontmatter":{},"headers":[],"relativePath":"zh/manual/editor/publish/android/build-setup-evn-android.md","filePath":"zh/manual/editor/publish/android/build-setup-evn-android.md"}'),D={name:"zh/manual/editor/publish/android/build-setup-evn-android.md"},b=a('<h1 id="android-原生开发环境配置" tabindex="-1">Android 原生开发环境配置 <a class="header-anchor" href="#android-原生开发环境配置" aria-label="Permalink to &quot;Android 原生开发环境配置&quot;">​</a></h1><h2 id="下载-android-studio" tabindex="-1">下载 Android Studio <a class="header-anchor" href="#下载-android-studio" aria-label="Permalink to &quot;下载 Android Studio&quot;">​</a></h2><p>开发者可以从 <a href="https://developer.android.com/studio" target="_blank" rel="noreferrer">Android Studio 官方网站</a> 下载对应的 IDE。</p><p>参考 <a href="./../setup-native-development.html##android-平台相关依赖">安装配置原生开发环境</a> 搭建开发环境。</p><h2 id="下载并安装-jdk" tabindex="-1">下载并安装 JDK <a class="header-anchor" href="#下载并安装-jdk" aria-label="Permalink to &quot;下载并安装 JDK&quot;">​</a></h2><p>参考 <a href="./../setup-native-development.html#下载-java-sdk（jdk）">安装配置原生开发环境 - 下载 Java SDK（JDK）</a></p><p>在终端中输入 <code>java -version</code> 查看是否安装成功</p><p><img src="'+r+'" alt="terminal.png"></p><blockquote><p>需要配置对应的环境变量，请参考 <a href="https://www.java.com/zh_CN/download/help/path.xml" target="_blank" rel="noreferrer">如何设置或更改 JAVA 系统环境变量</a>。 <br></p><p><strong>注意</strong>：<a href="https://openjdk.org/" target="_blank" rel="noreferrer">OpenJDK</a> 和 JDK 仅是开源协议不同，功能和配置方法没有本质区别。</p></blockquote><h2 id="下载并安装-android-sdk" tabindex="-1">下载并安装 Android SDK <a class="header-anchor" href="#下载并安装-android-sdk" aria-label="Permalink to &quot;下载并安装 Android SDK&quot;">​</a></h2><h3 id="自动下载" tabindex="-1">自动下载 <a class="header-anchor" href="#自动下载" aria-label="Permalink to &quot;自动下载&quot;">​</a></h3><p>在 Android Studio 中下载 Android SDK 步骤如下：</p><ol><li><p>启动 Android Studio</p></li><li><p>通过下列菜单打开 Setting 面板 <img src="'+A+'" alt="as-setting.png"></p></li><li><p>在 Setting 内找到 SDK 下载分页 <img src="'+e+'" alt="download-sdk.png"></p></li><li><p>选中对应版本的 SDK 并加载，可以选择使用 <a href="./../setup-native-development.html#下载发布-android-平台所需的-sdk-和-ndk">下载发布 Android 平台所需的 SDK 和 NDK</a> 中推荐的版本</p><ul><li><p>以 Android 11.0(R) 为示例，选中 Name 前的勾并点击上图中的 OK 或者 Apply 按钮。</p></li><li><p>在弹出框中选择 OK <img src="'+d+'" alt="confirm-change.png"></p></li><li><p>下载 <img src="'+s+'" alt="component-installer.png"></p></li></ul></li></ol><h3 id="手动下载" tabindex="-1">手动下载 <a class="header-anchor" href="#手动下载" aria-label="Permalink to &quot;手动下载&quot;">​</a></h3><p>如果出现网络问题无法在 Android Studio 中下载 Android SDK，可以通过手动的方式下载并放在 <strong>Android SDK Location</strong> 目录内。</p><p>下载完成后，可以在 Android Studio 内配置 SDK，如下图所示：</p><p><img src="'+i+'" alt="sdk-location.png"></p><p>无法下载 SDK 时，可以修改代理，配置镜像：</p><p>在 Android Studio 中配置 HTTP 代理：</p><p><strong>自动配置代理</strong>：在 Setting 中找到 HTTP Proxy，勾选 Auto-detect proxy settings，填入下方描述的镜像源，以腾讯源为例：</p><p><img src="'+p+'" alt="http-proxy.png"></p><p><strong>可选的镜像源</strong>：安卓 SDK 以及下文中提到的 Gradle 都会有一些镜像源用于帮助您解决无法从官网下载的问题，如果下方表格的镜像也无法解决，也可以从搜索引擎获取。</p><table><thead><tr><th style="text-align:left;">镜像源</th><th style="text-align:left;">地址</th></tr></thead><tbody><tr><td style="text-align:left;">腾讯</td><td style="text-align:left;"><a href="https://mirrors.cloud.tencent.com/AndroidSDK/" target="_blank" rel="noreferrer">https://mirrors.cloud.tencent.com/AndroidSDK/</a></td></tr><tr><td style="text-align:left;">阿里云</td><td style="text-align:left;"><a href="https://mirrors.aliyun.com/android.googlesource.com/" target="_blank" rel="noreferrer">https://mirrors.aliyun.com/android.googlesource.com/</a></td></tr></tbody></table><blockquote><p>如果出现镜像不可用的情况，您可以视可用性更换不同的镜像源。</p></blockquote><h2 id="下载并安装-ndk" tabindex="-1">下载并安装 NDK <a class="header-anchor" href="#下载并安装-ndk" aria-label="Permalink to &quot;下载并安装 NDK&quot;">​</a></h2><p>根据 <a href="./../setup-native-development.html">安装配置原生开发环境 - 下载发布 Android 平台所需的 SDK 和 NDK</a> 推荐的版本区间下载 NDK（推荐使用版本为 <strong>r18~21</strong>）。</p><h3 id="通过-android-studio-下载-ndk" tabindex="-1">通过 Android Studio 下载 NDK <a class="header-anchor" href="#通过-android-studio-下载-ndk" aria-label="Permalink to &quot;通过 Android Studio 下载 NDK&quot;">​</a></h3><p>打开 Android Studio 的 <strong>Setting</strong> 窗口，找到 <strong>Android SDK</strong> 分页：</p><blockquote><p><strong>注意</strong>：需要勾选 <strong>Show Package Details</strong>: <br></p></blockquote><p><img src="'+l+'" alt="show-package-details.png"></p><p><img src="'+c+'" alt="download-ndk-by-as.png"></p><p>勾选合适的版本进行下载，如果无法刷新出所有 NDK 版本，请查看下文手动下载部分。</p><h3 id="手动下载-ndk" tabindex="-1">手动下载 NDK <a class="header-anchor" href="#手动下载-ndk" aria-label="Permalink to &quot;手动下载 NDK&quot;">​</a></h3><p>您可以在 <a href="https://github.com/android/ndk/wiki/Unsupported-Downloads#r20b" target="_blank" rel="noreferrer">历史版本</a> 找到下载。</p><p>在上述地址中找到对应平台的 NDK 版本并下载，此处以 r20b 为例，选择您的操作系统所需的安装包，下载并解压到本地。</p><p><img src="'+g+'" alt="download-ndk.png"></p><h2 id="配置-sdk-和-ndk" tabindex="-1">配置 SDK 和 NDK <a class="header-anchor" href="#配置-sdk-和-ndk" aria-label="Permalink to &quot;配置 SDK 和 NDK&quot;">​</a></h2><p>回到 Cocos Creator 中，在 <strong>文件</strong> -&gt; <strong>偏好设置</strong> 内找到 <strong>程序管理器</strong>，并配置好 Android NDK 和 Android SDK：</p><p><img src="'+h+'" alt="program.png"></p><p>目录选择如下：</p><p><strong>NDK：</strong></p><p><img src="'+u+'" alt="ndk-dir.png"></p><p><strong>SDK：</strong></p><p><img src="'+m+'" alt="sdk-dir.png"></p>',44),k=[b];function B(K,f,Y,T,N,M){return n(),o("div",null,k)}const Q=t(D,[["render",B]]);export{E as __pageData,Q as default};
